import styled from 'styled-components';

export const Container = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  background: #ffffff;
  width: 250px;
  height: 250px;
  border-radius: 5%;

  display: flex;
`;
export const CartTitle = styled.h1`
  font-size: 16px;
  color: var(--text-color);
  text-align: center;
  width: 100%;
  height: fit-content;
  padding: 10px;
`;
